import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import  Register  from "./login_screens/register/register";
import  Login  from "./login_screens/login/login";
import  Forgot from "./login_screens/forgot/forgot";
import Settings from "./Settings/main/Settings";
import SettingsAccount from "./Settings/Account/Account";



function App() {
  return (
    <Router>
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/forgot" element={<Forgot />} />
        <Route path="/settings" element={<Settings />} />
        <Route path="/settings/account" element={<Settings />} />
      </Routes>
    </Router>
  );
}

export default App;
